import React from "react";

const Footer = () => {
    return (
        <footer className="footer">
            <a href='https://www.bcit.ca/copyright/'><text>Copyright</text></a>
            &nbsp; &nbsp; &nbsp;
            <a href='https://www.bcit.ca/privacy/'><text>Privacy</text></a>
        </footer>
    );
}

export default Footer;
